mapper.select:

select id, isuse, pcauth, appauth, cfg_dir, dt_cfg, account_type, account_key, custom_sql, 
creater, createdate, createtime, modifier, modifydate, modifytime
from Int_SAML_Cfg where 1=1 

   and id = #{id,jdbcType=INTEGER}


   and isuse = #{isuse,jdbcType=VARCHAR}


   and pcauth = #{pcauth,jdbcType=VARCHAR}


   and appauth = #{appauth,jdbcType=VARCHAR}


   and cfg_dir = #{cfgDir,jdbcType=VARCHAR}


   and dt_cfg = #{dtCfg,jdbcType=VARCHAR}


   and account_type = #{accountType,jdbcType=VARCHAR}


   and account_key = #{accountKey,jdbcType=VARCHAR}


   and custom_sql = #{customSql,jdbcType=VARCHAR}


   and creater = #{creater,jdbcType=INTEGER}


   and createdate = #{createdate,jdbcType=VARCHAR}


   and createtime = #{createtime,jdbcType=VARCHAR}


   and modifier = #{modifier,jdbcType=INTEGER}


   and modifydate = #{modifydate,jdbcType=VARCHAR}


   and modifytime = #{modifytime,jdbcType=VARCHAR}
